import React, {Component}  from 'react';

class Register extends Component{
  constructor() {
    super();
    this.state = {
      email: "",
      name: "",
      password: "",
      password2: "",
      errors: ""
    };
  }
  onChange = e => {
    this.setState({ [e.target.id]: e.target.value });
  };
  onSubmit = e => {
    e.preventDefault();
    const userData = {
      email: this.state.email,
      name: this.state.name,
      password: this.state.password,
      password2: this.state.password2
    };
    console.log(userData);
  }
  render(){
    return (
      <div>
        <form>
          <div>
          <input placeholder="email" id="email" onChange={this.onChange}></input>
          </div>
          <div>
          <input placeholder="username" id="name" onChange={this.onChange}></input>
          </div>
          <div>
          <input placeholder="password" id="password" onChange={this.onChange}></input>
          </div>
          <div>
          <input placeholder="confirm password" id="password2" onChange={this.onChange}></input>
          </div>
          <button type="submit" onSubmit={this.onSubmit}>Submit</button>
        </form>
      </div>
    )
  }
};
export default Register;
